import React, { useEffect, useState } from 'react';
import GlobalStyles from 'components/styled/Global';
import { OuterWrapper, InnerWrapper } from 'components/styled/Wrappers.styled';
import Header from './components/Header';
import Summary from './components/Summary';
import Tech from './components/Tech';
import FeatProjects from './components/FeatProjects';
import OtherProjects from './components/OtherProjects';
import Thoughts from './components/Thoughts';
import Skills from './components/Skills';
import ForMore from './components/ForMore';
import Footer from './components/Footer';
import API_TOKEN from '../secret';

const App = () => {
  const [repos, setRepos] = useState([]);
  const options = {
    method: 'GET',
    headers: {
      Authorization: `token ${API_TOKEN}`
    }
  };
  console.log(API_TOKEN)

  useEffect(() => {
    fetch('https://api.github.com/users/karlfredrikholm/repos', options)
      .then((res) => res.json())
      .then((data) => setRepos(data))
      .catch((error) => console.error(error))
  }, []);

  return (
    <>
      <GlobalStyles />
      <OuterWrapper>
        <InnerWrapper>
          <Header />
          <Summary />
          <Tech />
          <FeatProjects />
          <OtherProjects repos={repos} />
          <Thoughts />
          <Skills />
          <ForMore />
          <Footer />
        </InnerWrapper>
      </OuterWrapper>
    </>
  );
};

export default App;
